INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (0, "リリ", "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 321, 1, 2, 40011, 24001, 1, 1, 125801);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (0, "クリア", "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 322, 1, 2, 40011, 24001, 2, 1, 126001);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (0, "プレシア", "んーと。\nこれ、あげる。\nはい", 323, 1, 2, 40011, 24001, 3, 1, 126101);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (0, "リリ", "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 324, 2, 2, 40011, 24001, 4, 1, 125801);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (0, "クリア", "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 325, 2, 2, 40011, 24001, 5, 1, 126001);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (0, "プレシア", "お兄。\nきてくれて、うれしい", 326, 2, 2, 40011, 24001, 6, 1, 126101);
